import React from 'react';

import { DesktopFooter, ContactInfo, Title, Text } from './styled-components/FooterElements';




const Footer = () => {
    return(
        <DesktopFooter>
          <ContactInfo>
            <Title>Contact Us!</Title>
            <Text>
              PetSpotter Sweden <br />
              Djurvögen 2 <br />
              Ingen Var, Sweden <br />
              Tel: +46 00 00 12 34 <br />
              support.info@petspotters.se
            </Text>
          </ContactInfo>
          <Text>© Petspotter by Elaine Bergström and Malin Göthe</Text>
        </DesktopFooter>
    )
}

export default Footer
